import anthropic
import os
import base64
import httpx

client = anthropic.Anthropic(
    # os.environ.get("ANTHROPIC_API_KEY")
    api_key=os.environ.get("ANTHROPIC_API_KEY"),
)

image1_url = "https://upload.wikimedia.org/wikipedia/commons/a/a7/Camponotus_flavomarginatus_ant.jpg"
image1_media_type = "image/jpeg"
image1_data = base64.b64encode(httpx.get(image1_url).content).decode("utf-8")

message = client.messages.create(
    model="claude-3-opus-20240229",
    max_tokens=1000,
    temperature=0.1,
    system="""
    You are a helpful assistant with vision capabilities. You are given an image and a prompt. You need to analyze the image and generate a response based on the prompt.
    """,
    messages=[
        {
            "role": "user",
            "content": [
                {
                    "type": "image",
                    "source": {
                        "type": "base64",
                        "media_type": "image/jpeg",
                        "data": ""
                    }
                }
            ]
        },
        {
            "role": "assistant",
            "content": [
                {
                    "type": "text",
                    "text": "Sure! I will analyze the image and convert the information in JSON format."
                }
            ]
        },
        {
            "role": "user",
            "content": [
                {
                    "type": "text",
                    "text": "Please cross check the image and generate a response based on the prompt. Ensure that the response is in the format of a JSON object with the following fields: 'response'."
                }
            ]
        }
    ]
)
print(message.content)